<html><!---not ?64 version--->
<body>
    <pre>102 Processing request...</pre>
    <script id=sc>
        window.onload=()=>{
            document.getElementById("sc").innerText = "/* !null */";
            if(window.location.search != ''){
                var wlocs = window.location.search.slice(1);
                if(window.location.hash != ''){
                    var wloch = window.location.hash.slice(2);
                }else{
                    var wloch = "error";
                };
            }else{
                var wlocs = "https://nsqx.github.io/res/!/cd6935a.json";
                if(window.location.hash != ''){
                    var wloch = window.location.hash.slice(2);
                }else{
                    var wloch = "error";
                };
            };
            fetch(wlocs)
                .then( function (response) {return response.json();} )
                .then( function (data) {adl(data);} )
                .catch(function (err) {console.log(err); wloch = "error";} );
        };

        function adl(e){
            if(wloch != "error"){
                eval("document.querySelector('body').innerHTML = e.get.fetch." + wloch);
            }else{
                document.querySelector('body').innerHTML = e.get.error;
            }
        }
    </script>
</body>
</html>
